  input: '"TEXT","F3XN","C00034033","1. The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  2. The disbursements on Schedule B for printing, direct mail, meeting
    facilities, and catering were for general fundraising activities. They did not
    refer to a clearly identified candidate for Federal office, nor did they promote,
    support, attack, or oppose any candidate for Federal office.  3.  The transfer-in
    for the voided checks on Schedule H4 of 150 was $ 112.50.  This amount will be
    subtracted from our transfer-in for January 2004 and will be reported in our February
    2004 monthly report."'
